	setx 	_t1_spu_op_array, %l1, %l2
#ifdef SPU_8
#if (MAX_THREADS > 8)
        ! Add core ID offset
        or %l2, %o1, %l2
#endif
#endif
	ldx 	[%l2 + %i5], %i1 
	cmp	%i1, 7
	bne	_t1_not_ssl
	mov	%i5, %g5		!# Save _t1_real _t1_offset - _t1_if _t1_sslkey _t1_it _t1_has _t1_to _t1_be 0x10 _t1_aligned
	btst	8, %i5
	bz	_t1_not_ssl
	nop	
	add	%i5, 8, %i5

_t1_not_ssl:
	cmp	%i1, 8
	bg	_t1_fail
	mulx 	%i1, 8, %i1		!# Calc _t1_index _t1_into _t1_toc

	setx 	_t1_table_of_context, %l1, %l2
#ifdef SPU_8
#if  (MAX_THREADS > 8)
        ! Add core ID offset
        or %l2, %o1, %l2
#endif
#endif
	ldx 	[%l2 + %i1], %l3	!# l3 = _t1_toc _t1_of _t1_current _t1_operation
	ldx 	[%l3 + 0x40], %l4   	!# l4 = alignment array

    	!# set  CWQ data
	ldx	[%l3], %l2		
	ldx 	[%l2 + %i5], %l2	!# Get Control Word _t1_from _t1_array
	mov 	%l2, %i7		!# Save _t1_it _t1_for _t1_later
        srlx 	%i7, 48,  %l1
        and 	%l1, 1, %l1
        cmp 	%l1, 1
        bne,pn %xcc, _t1_write_cwq
	nop
	inc	%i6			!# increase _t1_interrupt _t1_counter

_t1_write_cwq:
    	!# write CWQ entry (%l6 points to CWQ)
    	stx  	%l2, [%l6 + 0x0]

    	!# source address
	ldx 	[%l3 + 0x8], %l2
	ldx	[%l4 + 0x8], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x8]

    	!# Authentication Key  Address (40-bit)
	ldx	[%l3 + 0x10], %l2
	ldx	[%l4 + 0x10], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x10]

    	!# Authentication IV   Address (40-bit)
	ldx	[%l3 + 0x18], %l2
	ldx	[%l4 + 0x18], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x18]

    	!# Authentication FSAS Address (40-bit)
	ldx	[%l3 + 0x20], %l2
	ldx	[%l4 + 0x20], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x20]

    	!# Encryption Key Address (40-bit)
	ldx 	[%l3 + 0x28], %l2
	ldx	[%l4 + 0x28], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x28]

    	!# Encryption Initialization Vector Address (40-bit)
	ldx 	[%l3 + 0x30], %l2
	ldx	[%l4 + 0x30], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x30]

    	!# Destination Address (40-bit)
    	ldx 	[%l3 + 0x38], %l2
	ldx	[%l4 + 0x38], %l1
	add	%l2, %i5, %l2
        add 	%l2, %l1, %l2		!# _t1_WARNING : Misaligned _t1_address
    	stx 	%l2, [%l6 + 0x38]

    	!# Make sure all these stores get to memory before we start
    	membar 	#Sync
    	ldx 	[%l6 + 0x20], %l2
    	ldx 	[%l6 + 0x28], %l2
    	ldx 	[%l6 + 0x30], %l2
    	ldx 	[%l6 + 0x38], %l2
    	membar 	#Sync

        wrpr %g0, 0x44, %pstate

    	!# Set the enabled bit and reset the other bits
    	or      %g0, 0x1, %g1
    	stxa    %g1,    [%g0 + ASI_SPU_CWQ_CSR] %asi

    	!# Kick off the CWQ operation by writing to the CWQ_TAIL
    	!# Now add 1 (actually 8*8B) to tail pointer
    	ldxa    [%g0 + ASI_SPU_CWQ_TAIL] %asi, %l2
    	add 	%l2, 0x40, %l2
    	stxa    %l2, [%g0 + ASI_SPU_CWQ_TAIL] %asi
    	ldxa    [%g0 + ASI_SPU_CWQ_TAIL] %asi, %l1
    	cmp 	%l1, %l2
    	bne,pn 	%xcc,    _t1_fail
    	nop

    	!# CWQ_SYNC operation...
    	ldxa    [%g0 + 0x30] %asi, %l1

    rdhpr %halt, %g7
    wrpr %g0, 0xf7, %pstate

    andn %l1, 0x10, %l1  !# clear interrupt request bit
	addcc	%l1, -1, %i0
	bne	_t1_fail			!# test for unexpected protocal error
	nop
    	ldxa    [%g0 + ASI_SPU_CWQ_HEAD] %asi, %l1
    	ldxa    [%g0 + ASI_SPU_CWQ_TAIL] %asi, %l1
    !# I want to check all the data
	or %g0, 260, %i0    
	or %g0, %g0, %g3   
_t1_check_msg:
	ldx 	[%l3 + 0x8], %l5	!# Needed _t1_for Inplace
	add	%l5, %i5, %l5
	ldx     [%l5 + %g3], %l1
	add     %g3, 0x8, %g3   !# i++
	addcc   %i0, -1, %i0
	bgt     _t1_check_msg
	nop
    !# I want to check all the data
	or %g0, 260, %i0    
	or %g0, %g0, %g3   
_t1_check_results:
	ldx	[%l3 + 0x38], %l5	!# Needed _t1_for Copy
	add	%l5, %i5, %l5
	ldx     [%l5 + %g3], %l1
	add     %g3, 0x8, %g3   !# i++
	addcc   %i0, -1, %i0
	bgt     _t1_check_results
	nop

	or %g0, 0x8, %i0    
	or %g0, %g0, %g3   
_t1_check_sfas:
	ldx	[%l3 + 0x20], %l5
	ldx     [%l5 + %g3], %l1
	add     %g3, 0x8, %g3   !# i++
	addcc   %i0, -1, %i0
	bgt     _t1_check_sfas 
	nop

    !# I want to check all the State 32 words + 2 bytes XY
	or %g0, 0x23, %i0    
	or %g0, %g0, %g3   
_t1_check_state:
	ldx	[%l3 + 0x28], %l5		!# Needed _t1_for Streamout
	ldx     [%l5 + %g3], %l1
	add     %g3, 0x8, %g3   !# i++
	addcc   %i0, -1, %i0
	bgt     _t1_check_state
	nop

	mov	%g5, %i5
	add	%l6, 0x40, %l6  	!# next CWQ address
	add	%i5, 8, %i5		!# next _t1_offset 
	add	%i4, 1, %i4		!# loop _t1_counter
	cmp 	%i4, 10
	bl	_t1_main_loop
	nop	

	!call 	check_int_cnt		!# Check #ints (assuming all have happened at this time!)
	nop

    	EXIT_GOOD

_t1_fail:
    	EXIT_BAD

_t1_check_int_cnt:
 	cmp %g0, %i6
        bne,pn %xcc, _t1_fail
	nop
        retl
	nop


